import styled from 'styled-components';

export const EditButton = styled.button`
  font-size: 25px;
  cursor: pointer;
  margin-left: 10px;
  width: 28px;
  height: 28px;
  border-radius: 5px;
  background-color: #FFD84F;
  display: flex;
  justify-content: center;
  align-items: center;
  border: none;
`;
